import React from 'react'
import { Route, Routes, Link } from 'react-router-dom';
import Full from './Full'
import App from './App';
import News from './news';
// import About from './About'

const Footer = () => {
  return (
    <div className='footer'>
        <h5>CryptoCurrencies</h5>
        <h6>All Rights Reserved</h6>
        <ul>
        <li className='active'><Link to="/" className='tag'>Home</Link></li>
              <li><Link to="/Crypto" className='tag'>Crypto Currency</Link></li>
              <li><Link to="/News" className='tag'>News</Link></li>
              {/* <li><Link to="/About" className='tag'>About</Link></li> */}
        </ul>

        <Routes>
            <Route path="/" element={<App/>}></Route>
            <Route path="/Crypto" element={<Full/>}></Route>
            <Route path="/News" element={<News/>}></Route>
            {/* <Route path="/About" element={<About/>}></Route> */}
      </Routes>
    </div>
  )
}

export default Footer
